import React from 'react';
import { Link } from 'react-router-dom';

const Navbar = () => {
  return (
    <nav style={styles.navbar} dir="rtl">
      <div style={styles.navContent}>
        <div>
          <Link to="/Home" style={styles.link}>בית</Link>
          <Link to="/new-auction" style={styles.link}>התחל מכרז חדש</Link>
          <Link to="/profile" style={styles.link}>פרופיל</Link>
          <Link to="/login" style={styles.link}>כניסה לחשבון</Link>
          <Link to="/logout" style={styles.link}>התנתק</Link>
        </div>
      </div>
    </nav>
  );
};

const styles = {
  navbar: {
    position: 'fixed',
    top: 0,
    width: '100%',
    backgroundColor: '#1e90ff',
    padding: '10px 20px',
    zIndex: 1000,
  },
  navContent: {
    display: 'flex',
    justifyContent: 'flex-end',
    alignItems: 'center',
  },
  link: {
    color: 'white',
    marginLeft: '20px',
    textDecoration: 'none',
    fontWeight: 'bold',
  },
};

export default Navbar;
